import React, { Component } from "react";
import { Card, Icon, Row } from "antd";
import "../App.css";

class Asset extends Component {
  render() {
    return (
      <Card hoverable>
        <h3>{this.props.asset.id}</h3>
        <div>
          <h2 style={{ float: "left" }}>{this.getAsset()}</h2>
          <h2 style={{ float: "right" }}>${this.getCurrency()}</h2>
        </div>
      </Card>
    );
  }

  getAsset() {
    var num = this.props.asset.value;
    num = num.toFixed(4);
    return num;
  }

  getCurrency() {
    var cur = this.props.asset.value;
    cur = cur.toFixed(2);
    return cur;
  }
}

export default Asset;
